import React from "react";

const Necas = ({ text }) => {
  console.log(text);
  return (
    <div className="Firo">
      {text.Search.map((t) => {
        <p>{t.Title}</p>;
      })}
      ;
    </div>
  );
};

Necas.defaultProps = {
  text: ["Sharknado"],
};

export default Necas;
